import './Header.css';
import {Link} from 'react';

function Header() {
  return (
    <div className="Header">
      <h1>"hello"</h1>
      <nav>
      <Link to="/merch">MERCH</Link>
      <p>MERCH</p>
      </nav>
    </div>
  );
}

export default Header;
